        public static List<DicomTagWithValue> GetAll()
        {
            return typeof(DicomTags).
                GetFields(System.Reflection.BindingFlags.Public | System.Reflection.BindingFlags.Static).
                Select(x => {
                    var dicomTagAndValue = (DicomTagWithValue)x.GetValue(null);
                    dicomTagAndValue.Description = x.Name;
                    return dicomTagAndValue;
                }).ToList();
        }

        public static List<DicomTagWithValue> GetCommon()
        {
            List<DicomTagWithValue> dicomTagWithValues = new List<DicomTagWithValue>();

            // Patient Information
            dicomTagWithValues.Add(DicomTags.PatientName);
            dicomTagWithValues.Add(DicomTags.PatientID);
            dicomTagWithValues.Add(DicomTags.PatientBirthDate);
            dicomTagWithValues.Add(DicomTags.PatientSex);

            //Study Info
            dicomTagWithValues.Add(DicomTags.StudyDate);
            dicomTagWithValues.Add(DicomTags.StudyTime);
            dicomTagWithValues.Add(DicomTags.AccessionNumber);
            dicomTagWithValues.Add(DicomTags.StudyDescription);
            dicomTagWithValues.Add(DicomTags.StudyInstanceUID);
            dicomTagWithValues.Add(DicomTags.BodyPartExamined);
            dicomTagWithValues.Add(DicomTags.ExposureTime);
            dicomTagWithValues.Add(DicomTags.XRayTubeCurrent);
            dicomTagWithValues.Add(DicomTags.GeneratorPower);

            // Series Info
            dicomTagWithValues.Add(DicomTags.Modality);
            dicomTagWithValues.Add(DicomTags.SeriesInstanceUID);
            dicomTagWithValues.Add(DicomTags.SeriesDescription);
            dicomTagWithValues.Add(DicomTags.SeriesNumber);

            // Image Info
            dicomTagWithValues.Add(DicomTags.SOPInstanceUID);
            dicomTagWithValues.Add(DicomTags.InstanceNumber);
            dicomTagWithValues.Add(DicomTags.Rows);
            dicomTagWithValues.Add(DicomTags.Columns);
            dicomTagWithValues.Add(DicomTags.PixelSpacing);
            dicomTagWithValues.Add(DicomTags.WindowWidth);
            dicomTagWithValues.Add(DicomTags.WindowCenter);

            // Equipment / Technical
            dicomTagWithValues.Add(DicomTags.Manufacturer);
            dicomTagWithValues.Add(DicomTags.ManufacturerModelName);
            dicomTagWithValues.Add(DicomTags.SoftwareVersions);
            dicomTagWithValues.Add(DicomTags.DeviceSerialNumber);

            return dicomTagWithValues;
        }
